      "content": "<dd>\n<p>An identifiable set of data that describes an <a class=\"term-reference\" href=\"#term:entity\">entity</a>, which is the <a class=\"term-reference\" href=\"#term:subject\">subject</a> of the attribute.</p>\n</dd>\n<dd>\n<p>See also: <a class=\"term-reference\" href=\"#term:property\">property</a>.</p>\n</dd>\n<dd>\n<p>Supporting definitions:</p>\n</dd>\n<dd>\n<p><a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"essifLab-glossary#attribute\" href=\"https://essif-lab.github.io/framework/docs/essifLab-glossary#attribute\">eSSIF-Lab</a>: <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"data\" href=\"https://essif-lab.github.io/framework/docs/terms/data\">Data</a> that represents a characteristic that a <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"party\" href=\"https://essif-lab.github.io/framework/docs/terms/party\">party</a> (the <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"owner\" href=\"https://essif-lab.github.io/framework/docs/terms/owner\">owner</a> of the <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"attribute\" href=\"https://essif-lab.github.io/framework/docs/terms/attribute\">attribute</a>) has attributed to an <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"entity\" href=\"https://essif-lab.github.io/framework/docs/terms/entity\">entity</a> (which is the <a path-0=\"essif-lab.github.io\" path-1=\"framework\" path-2=\"docs\" path-3=\"terms\" path-4=\"subject\" href=\"https://essif-lab.github.io/framework/docs/terms/subject\">subject</a> of that attribute).</p>\n</dd>\n<dd class=\"last-dd\">\n<p>Note: An <a class=\"term-reference\" href=\"#term:identifier\">identifier</a> is an attribute that uniquely identifies an <a class=\"term-reference\" href=\"#term:entity\">entity</a> within some context.</p>\n</dd>"
